const Footer = () => {
	return (
		<>
			<footer className="footer mt-auto py-3 bg-dark">
				<div className="container">
					<p className="text-light">App desenvolvido por <a href="https://github.com/rabispedro" target="_blank" rel="noreferrer">Pedro Rabis</a></p>
					<p className="text-light"><small><strong>Semana Spring React</strong><br/>
						Evento promovido pela escola DevSuperior: <a href="https://www.instagram.com/pedrorabis/" target="_blank" rel="noreferrer">@pedrorabis</a></small></p>
				</div>
			</footer>
		</>
	);
};

export default Footer;
